/* global google */
import React from 'react';
import logo from './logo.svg';
import './App.css';
import {render} from 'react-dom';
import { Map, GoogleApiWrapper } from 'google-maps-react';

function App() {

    render()
    {
        return (
            < Map
        google = {this.props.google}
        zoom = {8}
        style = {mapStyles}
        initialCenter = {
        {
            lat: 47.444, lng
        :
            -122.176
        }
    }
        />
    )
        ;
    }
}



export default App;
